import React, { Component } from 'react'

class ErrorHandlingComponent extends Component {

    render() {
        if(this.props.error)
            return <h1></h1>
        return (
            <div>
               {this.props.name}
            </div>
        )
    }
}

export default ErrorHandlingComponent
